import logo from "./image/troll-face.png";

function Header() {
  return (
    <header>
        <div className='logo-title'>
            <img src={logo} alt="meme" />
            <h2 className="title">LOL   MEME   LORD</h2>
        </div>
    </header>

  )
}

export default Header
